export const languageWarnings = {
  en: {
    greeting: 'Hello 🙂',
    instructions: 'Just a heads up, menus can be full of colloquialism and words that don’t translate perfectly. We’ve done our best but there may be mistakes and we’d love your feedback to help make it perfect. Thank you!',
    confirmation: 'Got it!',
  },
  fr: {
    greeting: 'Bonjour 🙂',
    instructions: 'Un petit avertissement, les menus sont souvent pleins de mots familiers ou de mots qui ne se traduisent pas parfaitement. Nous avons fait de notre mieux mais quelques erreurs sont possibles et nous aimerions recevoir vos commentaires pour améliorer votre experience. Merci beaucoup!',
    confirmation: "Je l'ai!",
  },
  el: {
    greeting: 'Καλημερα 🙂',
    instructions: 'Τα μενου μπορει να εχουν λαικες λεξεις που δεν μεταφραζοντε κανονικα. Εχουμε κανει το καλυτερο μας αλλα μπορει να ηπαρχουν μερικα λαθη. Θα μας ευχαριστουσε αν μας δεινατε την γνωμη σας για να το κανουμε τελειο. Σας ευχαριστουμε!',
    confirmation: 'Το κατάλαβα!',
  },
  zhCN: {
    greeting: '你好 🙂',
    instructions: '温馨提示，我们已经尽力的帮您翻译但是由于餐牌有很多字和俗话都不能直接的被翻译，所以餐牌内容还是有可能会有错误。我们欢迎您的反馈好让我们帮您做到完美无缺的餐牌。谢谢',
    confirmation: '得到它了！',
  },
  es: {
    greeting: 'Hola 🙂',
    instructions: 'Los menús pueden estar llenos de coloquialismo y palabras que no se traducen correctamente. Hemos hecho todo lo posible, pero puede haber errores y nos encantaría recibir tus comentarios para mejorarlo. ¡Gracias!',
    confirmation: '¡Lo tengo!',
  },
  it: {
    greeting: 'Ciao 🙂',
    instructions: 'Solo una precisazione, i menu possono essere pieni di espressioni e parole non tradotti perfettamente. Noi abbiamo fatto del nostro meglio ma possono esserci errori e ci piacerebbe un tuo feedback per perfezionarli. Grazie!',
    confirmation: 'Fatto!',
  },
}
